import React from 'react';
import style from './header.module.css';

const Header = () => {
    return (
        <nav className={style.nav}>
            <div className={style.logo}>salary</div>
            <ul>
                <li>
                    <div>앱 화면</div>
                    <div></div>
                </li>
            </ul>
        </nav>
    );
};

export default Header;
